209	209	820	The first rule of microphones is that, "No one microphone is perfect for every purpose."  Rule two is, "Experiment with different mics in different applications to find your signature sound."  I've used Shure SM58's along with their ancestors and relatives back to 1968.  I primarily used them for broadcasting and recording spoken word content but I have used (and still do use) them for singing some back up vocals.The SM58 does one thing well and that is vocal performance when used very close to the mouth for public address use.  Some people, me included, actually sound better and more comfortable in a live performance setting when using another mic, the Shure SM-57.  The SM-58 is a very good vocal mic and for some people probably the best choice.  For example, anyone who can not resist putting the mic right up against their lips while singing will probably want the SM-58.  People with softer or weaker voices will want the SM-58.The SM-58 is highly directional and has a noticeable yet manageable proximity effect (which means the bass increases the closer you get.)  This mic does not pick up well from much over 8 inches away.  The reason so many singers think you are supposed to shove microphones practically inside your mouth is because the ball type Shure vocal mics require you to get them very close or they don't sound right.  On the other hand, the SM-57 sounds best several inches away from the user's mouth and works fine up to 12 inches away.  While the SM-58 is certainly the number one professional PA vocal mic, there are precious few other uses for it because it has a colored sound with a prominent frequency response boost in the upper midrange plus a sound source has to be very close before it is picked up clearly.  It works ok for conga drums and the like, but the SM-58 is about the last thing you'd want to use to mic a sax or guitar.  Personally these mics are not the best for my mic technique or the basic nature my voice, but for some people they