1063	1063	615	Put away your effects pedals, modellers, and software for awhile and get back to the earth - or at least the simple appreciation of what an electric guitar sound can be, straight off the axe with nothing but pickups, volume, and tone pots to shape it.For me the classic Pignose-and-a-Strat sound is the opening of "I Looked Away" from Layla, but I'm sure everyone's got their favorites.Loud enough to "feel the air" and coax a variety of natural-sounding distorted tones. Stick an SM-57 in front of it and fool a lot of people into thinking it's a tube amp. By working your guitar knobs you can get a clean sound, along with that "barely breaking up" holy grail of tone for many blues and rock players.By learning how much you can do with relatively little, you'll gain a new appreciation of the strengths and weaknesses of all the tone-shaping tools that have come along since.It might surprise those who take today's hyper-saturated, over-processed metal distortion for granted as the official, community-sanctioned guitar tone to discover the challenges and pleasure of touch and response with subtle dynamics and without infinite sustain.One bit of weirdness: When I began playing my Pignose I immediately noticed a buzz, as though something small was rattling around between the speaker cone and front grill. The four mounting nuts were easy to loosen and, sure enough, an extra washer had gotten caught in there during assembly. Fortunately it slid right out and there was no damage.Get the power adapter and save the batteries for when you absolutely have no choice.The first amp I ever had was a small Ampeg tube from the early 60's with a single 6 inch speaker, volume and tone knobs. I've no idea how many watts it put out - not enough for my parents to complain from their bedroom next door. With that baby cranked, I spent many happy hours in tone heaven. All these years (and amps) later I guess I've always been searching for that sound and the Pignose comes closer than any tube distortion, blues overdrive pedal or rat-ty box I've tried.For the money, you can't beat it.	5	2023-04-22
