1067	1067	619	The Pignose is not the world's best travel amp, or portable amp, or practice amp. It's not very good for vocals, it's inefficient, what with its 40-year old design, and it distorts way too easy. There are far better amps for most purposes from Boss and others that deliver a lot more clean volume, thanks to modern class-D amp technology, and a variety of digital effects to boot.BUT... there is one area where the Pig prevails. If you're looking for the sound of a big overdriven amp in the studio, or miked on stage, the Pignose will give you that sound for less than the cost of one good quality overdrive pedal. By opening and closing the box, you can get a range of cabinet sounds from the open-back Fender to the classic Marchall sealed cab, and everything in between. Frank Zappa recorded a lot of his guitar parts using nothing but his SG running into a Pignose, and he got fantastic sounds.Beyond that, it's cool looking, reasonably rugged, and even has pegs that allow you to hang it from a guitar strap. Every rocker needs one.	5	2023-04-26
1068	1068	620	The previous reviews are pretty accurate, though I would add that when the Pignose cabinet is closed, it can often sound rather boxy. It sounded much clearer and cleaner when it was opened a couple of inches.As for using pedals with it, it will take distortion to a degree. It reaches a point, if pushed too hard, at which the definition of the distortion will begin turning mushy and shrill. You can use a distortion + overdrive to decent effect, especially if you are running a cleaner sounding OD like a Tube Screamer. I don't think it would do so well with a Bad Monkey, for example, though, which has more dirt in the tones it produces. I don't have a fuzz box (not yet, but have one on order), but I think most fuzzes will sound like crap unless you use a relatively cleaner, sweeter one like the Red Witch Fuzz God or the Seymour Duncan Tweak Fuzz. Otherwise, you will hear too much ground asphalt in the sound.My wah wah, a Morley Power Wah, was almost useless with it. The limited frequency response of the 5" speaker made it sound overly throaty on cleans and when I put the boost in the shrillness would show itself again.A chorus pedal sounds totally sweet on it, but a phaser, in my case, a Phase 90, just destroys the sound. A flanger is also not really advisable. You can use delay, just not with very rapid repeats. Putting a compressor in front of your clean signal would probably make it more manageable for the Pignose' speaker. I just bought a Dynacomp, but haven't tried it on the piggy.This is a good cheap first amp to buy for a youngster who is just beginning their journey on guitar and for practice when you are on the road on vacation or business. Once the young 'un seems dedicated, though, it is time to think about moving up to a VOX AC15C1 (note: that amp can do hard rock fine, but not high gain metal) or an ENGL Screamer. I personally can't imagine recording with it, but Y guess that would depend on the engineering skills available to you.	3	2023-04-