d tubes that is simply sublime. Check out BB's tone on the legendary Live At The Regal to hear what I mean. That's the stuff.So, if you haven't tried pure nickels, spend a buck or two more (or maybe less!) than you normally do and give these bargain-priced nickels a try. You might find that you're a convert within seconds. I know that my ears sure love them when things are really cranked up; those Zep and Jimi riffs just sound and feel so much more right with pure nickel. And digging into some Otis Rush or Billy Gibbons licks is like night and day. The bluesy stuff just begs for pure nickels.Hell of a bargain at less than five bucks.	5	2023-07-24
